import React from 'react';
import Switch from "./switch";
import VacancyCard from "./vacancyCard";
import deloitte from "../images/deloitte.png"

export default function Vacancies() {

    const vacancies = [
        {id: 1, title: "Менеджер з комунікацій", description: " Задачі: встановлення партнерств, комунікація з клієнтами", company: "Deloitte", image: "deloitte"},
        {id: 2, title: 'Менеджер з комунікацій', description: " Задачі: встановлення партнерств, комунікація з клієнтами", company: "Deloitte", image: "deloitte"}
    ];

    return (
        <div className="container">
            <div className="row center-row">
                <Switch/>
            </div>
            {vacancies.map(function(vacancy, i){
                return (
                    <VacancyCard
                        key={i}
                        title={vacancy.title}
                        description={vacancy.description}
                        company={vacancy.company}
                        image={vacancy.image}
                    />
                    )
            })}
        </div>
    )
}
